import React from 'react';
import styled from 'styled-components'
import Header from './Home';
import NavBar from './components/Home/NavBar/Nav';
// import SlideShow from './components/Home/PhotoSlide/Gallery'

export default function Index() {
    return (
      <>
          <section className="header">
              <Header />
              <hr/>
              <NavBar />
          </section>
          <section className="gallery">
              {/* <SlideShow /> */}
          </section>
        <p>Hello Next.js</p>
        <style jsx>{`
              div,
            .header-container{
                width: 100%;
                height: 60%;
                display:flex;
                align-items:flex-start;
                background-color: violet;
                margin-bottom: 1rem;
            },
            .logo-contact{
                width: 60%;
                height: 95%;
                margin: 0 5% 0 2%;
                // background-color: pink;
            },
            .logo-contact img{
                width: 50%;
                height: 90%;
            }
            .header-contact {
                width: 90%;
                height: 100%;
                display: flex;
                justify-content: center;
                align-items: flex-end;
                // background-color: black;
            },
            .cotiza{
                width: 100%;
                height: 80%;
                display:flex
                justify-content: center;
                align-items: flex-end;
                // background-color: gray;
            },
            .cotiza img{
                width: 45px;
                height: 45px;
            }
            .info-cotiza {
                width: 100%;
                height: 60%;
                display: flex;
                justify-content: center;
                align-items: flex-start;
                flex-direction: column;  
                // background-color: yellow;
            }
            .info-cotiza p:first-child {
                display: flex;
                align-items: center;
                font-family: 'Raleway', sans-serif;
                height: 50%;
                width: 90%;
                color: #000;
                font-size: 0.8rem;
                // background-color: violet;
            },
            .info-cotiza h1 {
                display: flex;
                align-items: center;
                font-family: 'Raleway', sans-serif;
                height: 70%;
                width: 100%;
                font-size: 0.8rem;
                font-weight: lighter;
                color: #000;
            }

            
         `}</style>
      </>
    );
  }
